import axios from "axios";

export const appLogin = async (username, password) => {
  const response = await axios
    .post("http://localhost:5000/getTokenLogin", {
      username: username,
      password: password,
    })
    .then((response) => {
      return response;
    })
    .catch((error) => {
      console.log(error);
    });
  return response;
};

//Recuperar los proyectos del usuario
export const getProjects = async (token, userId) => {
  const response = await axios
    .post("http://localhost:5000/projects", {
      token: token,
    })
    .then((response) => {
      return response;
    })
    .catch((error) => {
      console.log(error);
    });
  return response;
};
